import "./styles.scss";

const PageUp = ({ menu, view, setView }) => {
  return (
    <nav className="page-up"
      onMouseEnter = { (event) => {
        document.querySelectorAll(".arrowuptext").forEach(arrow => {
          arrow.innerHTML=menu[view-1].at(0).toUpperCase()+menu[view-1].slice(1,menu[view-1].length)
        })
      }}
    >
      <div className="arrow">
        <div />
        <div />
      </div>
      <div className="arrowuptext">
      </div>
    </nav>
  )
}

export default PageUp
